import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Button from "@material-ui/core/Button";
import homepageimage1 from './homepageimage1.jpg';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      numClicks: 0
  }}

  handleClick = () => {
    this.setState({
      numClicks: this.state.numClicks + 1
    });

  }
  render() {
    return (
      <div className="App">
        <nav className="navbar overall-menu">

          <h3 class="navbar-brand">Hope in Seattle</h3>
          <ul className="menu-options">
            <li className="nav-item">Home</li>
            <li className="nav-item">About our Organization</li>
            <li className="nav-item">The Facts</li>
            <li className="nav-item">How to Help</li>
          </ul>

        </nav>

        <main>
          <section>
            <img className="opacity60" src={homepageimage1}/>

          </section>



        </main>

      </div>
    );
  }
}

export default App;
